const u=["\uC0DD\uBA85\uC758\uC0B6","\uB9E4\uC77C\uC131\uACBD","\uB9E4\uC77C\uC131\uACBD \uC21C","\uB9E4\uC77C\uC131\uACBD \uC601\uC5B4","\uB9E4\uC77C\uC131\uACBD \uCCAD\uC18C\uB144"],C={\uB178\uC158\uD1B5\uD569\uB4F1\uB85D:"https://www.notion.so/my-integrations",\uAD6C\uB3C5\uAC00\uC774\uB4DC:"https://bepyan.notion.site/bb424a05431745749e025e9df6e5d59b",\uB370\uC774\uD130\uBCA0\uC774\uC2A4_\uC608\uC2DC:"https://bepyan.notion.site/1ce713edac2440d3abf639d6745703e9?v=73b0118363eb4133930fb97e0639c042",\uBCF8\uBB38_\uC608\uC2DC:"https://bepyan.notion.site/38-22-38-9e65ca1a880a44a1894bc49588e33c26"},B={title:"\uD558\uB098\uB2D8\uC758 \uC815\uC758, \uC2EC\uD310\uC790\uC758 \uC804\uC9C0\uD558\uC2EC",date:"2021.12.15 (\uC218)",range:"\uC6A5\uAE30 34 : 21~37",verses:[{text:"\uC2EC\uD310\uC790\uC774\uC2E0 \uD558\uB098\uB2D8\uC5D0 \uB300\uD55C \uBCC0\uD638 34:21~30"},{verse:21,text:"\uADF8\uB294 \uC0AC\uB78C\uC758 \uAE38\uC744 \uC8FC\uBAA9\uD558\uC2DC\uBA70 \uC0AC\uB78C\uC758 \uBAA8\uB4E0 \uAC78\uC74C\uC744 \uAC10\uCC30\uD558\uC2DC\uB098\uB2C8"},{verse:22,text:"\uD589\uC545\uC790\uB294 \uC228\uC744 \uB9CC\uD55C \uD751\uC554\uC774\uB098 \uC0AC\uB9DD\uC758 \uADF8\uB298\uC774 \uC5C6\uB290\uB2C8\uB77C"},{verse:23,text:"\uD558\uB098\uB2D8\uC740 \uC0AC\uB78C\uC744 \uC2EC\uD310\uD558\uC2DC\uAE30\uC5D0 \uC624\uB798 \uC0DD\uAC01\uD558\uC2E4 \uAC83\uC774 \uC5C6\uC73C\uC2DC\uB2C8"},{verse:24,text:"\uC138\uB825 \uC788\uB294 \uC790\uB97C \uC870\uC0AC\uD560 \uAC83 \uC5C6\uC774 \uAEBE\uC73C\uC2DC\uACE0 \uB2E4\uB978 \uC0AC\uB78C\uC744 \uC138\uC6CC \uADF8\uB97C \uB300\uC2E0\uD558\uAC8C \uD558\uC2DC\uB290\uB2C8\uB77C"},{verse:25,text:"\uADF8\uB7EC\uBBC0\uB85C \uADF8\uB294 \uADF8\uB4E4\uC758 \uD589\uC704\uB97C \uC544\uC2DC\uACE0 \uADF8\uB4E4\uC744 \uBC24 \uC0AC\uC774\uC5D0 \uB4A4\uC9D1\uC5B4\uC5CE\uC5B4 \uD769\uC73C\uC2DC\uB294\uB3C4\uB2E4"},{verse:26,text:"\uADF8\uB4E4\uC744 \uC545\uD55C \uC790\uB85C \uC5EC\uACA8 \uC0AC\uB78C\uC758 \uB208 \uC55E\uC5D0\uC11C \uCE58\uC2EC\uC740"},{verse:27,text:"\uADF8\uB4E4\uC774 \uADF8\uB97C \uB5A0\uB098\uACE0 \uADF8\uC758 \uBAA8\uB4E0 \uAE38\uC744 \uAE68\uB2EC\uC544 \uC54C\uC9C0 \uBABB\uD568\uC774\uB77C"},{verse:28,text:"\uADF8\uB4E4\uC774 \uC774\uC640 \uAC19\uC774 \uD558\uC5EC \uAC00\uB09C\uD55C \uC790\uC758 \uBD80\uB974\uC9D6\uC74C\uC774 \uADF8\uC5D0\uAC8C \uC0C1\uB2EC\uD558\uAC8C \uD558\uBA70 \uBE48\uAD81\uD55C \uC0AC\uB78C\uC758 \uBD80\uB974\uC9D6\uC74C\uC774 \uADF8\uC5D0\uAC8C \uB4E4\uB9AC\uAC8C \uD558\uB290\uB2C8\uB77C"},{verse:29,text:"\uC8FC\uAED8\uC11C \uCE68\uBB35\uD558\uC2E0\uB2E4\uACE0 \uB204\uAC00 \uADF8\uB97C \uC815\uC8C4\uD558\uBA70 \uADF8\uAC00 \uC5BC\uAD74\uC744 \uAC00\uB9AC\uC2E0\uB2E4\uBA74 \uB204\uAC00 \uADF8\uB97C \uBD48\uC62C \uC218 \uC788\uC73C\uB7B4 \uADF8\uB294 \uBBFC\uC871\uC5D0\uAC8C\uB098 \uC778\uB958\uC5D0\uAC8C\uB098 \uB3D9\uC77C\uD558\uC2DC\uB2C8"},{verse:30,text:"\uC774\uB294 \uACBD\uAC74\uD558\uC9C0 \uBABB\uD55C \uC790\uAC00 \uAD8C\uC138\uB97C \uC7A1\uC544 \uBC31\uC131\uC744 \uC62D\uC544\uB9E4\uC9C0 \uBABB\uD558\uAC8C \uD558\uB824 \uD558\uC2EC\uC774\uB2C8\uB77C"},{text:"\uACB0\uB2E8 \uCD09\uAD6C\uC640 \uC6A5\uC5D0 \uB300\uD55C \uD3C9\uAC00 34: 31~37"},{verse:31,text:"\uADF8\uB300\uAC00 \uD558\uB098\uB2D8\uAED8 \uC544\uB8B0\uAE30\uB97C \uB0B4\uAC00 \uC8C4\uB97C \uC9C0\uC5C8\uC0AC\uC624\uB2C8 \uB2E4\uC2DC\uB294 \uBC94\uC8C4\uD558\uC9C0 \uC544\uB2C8\uD558\uACA0\uB098\uC774\uB2E4"},{verse:32,text:"\uB0B4\uAC00 \uAE68\uB2EB\uC9C0 \uBABB\uD558\uB294 \uAC83\uC744 \uB0B4\uAC8C \uAC00\uB974\uCE58\uC18C\uC11C \uB0B4\uAC00 \uC545\uC744 \uD589\uD558\uC600\uC73C\uB098 \uB2E4\uC2DC\uB294 \uC544\uB2C8\uD558\uACA0\uB098\uC774\uB2E4 \uD558\uC600\uB294\uAC00"},{verse:33,text:"\uD558\uB098\uB2D8\uAED8\uC11C \uADF8\uB300\uAC00 \uAC70\uC808\uD55C\uB2E4\uACE0 \uD558\uC5EC \uADF8\uB300\uC758 \uB73B\uB300\uB85C \uC18D\uC804\uC744 \uCE58\uB974\uC2DC\uACA0\uB290\uB0D0 \uADF8\uB7EC\uBA74 \uADF8\uB300\uAC00 \uC2A4\uC2A4\uB85C \uD0DD\uD560 \uAC83\uC774\uC694 \uB0B4\uAC00 \uD560 \uAC83\uC774 \uC544\uB2C8\uB2C8 \uADF8\uB300\uB294 \uC544\uB294 \uB300\uB85C \uB9D0\uD558\uB77C"},{verse:34,text:"\uC2AC\uAE30\uB85C\uC6B4 \uC790\uC640 \uB0B4 \uB9D0\uC744 \uB4E3\uB294 \uC9C0\uD61C \uC788\uB294 \uC0AC\uB78C\uC740 \uBC18\uB4DC\uC2DC \uB0B4\uAC8C \uB9D0\uD558\uAE30\uB97C"},{verse:35,text:"\uC6A5\uC774 \uBB34\uC2DD\uD558\uAC8C \uB9D0\uD558\uB2C8 \uADF8\uC758 \uB9D0\uC774 \uC9C0\uD61C\uB86D\uC9C0 \uBABB\uD558\uB3C4\uB2E4 \uD558\uB9AC\uB77C"},{verse:36,text:"\uB098\uB294 \uC6A5\uC774 \uB05D\uAE4C\uC9C0 \uC2DC\uD5D8 \uBC1B\uAE30\uB97C \uC6D0\uD558\uB178\uB2C8 \uC774\uB294 \uADF8 \uB300\uB2F5\uC774 \uC545\uC778\uACFC \uAC19\uC74C\uC774\uB77C"},{verse:37,text:"\uADF8\uAC00 \uADF8\uC758 \uC8C4\uC5D0 \uBC18\uC5ED\uC744 \uB354\uD558\uBA70 \uC6B0\uB9AC\uC640 \uC5B4\uC6B8\uB824 \uC190\uBF09\uC744 \uCE58\uBA70 \uD558\uB098\uB2D8\uC744 \uAC70\uC5ED\uD558\uB294 \uB9D0\uC744 \uB9CE\uC774 \uD558\uB294\uAD6C\uB098"}],commentaries:["\uC2EC\uD310\uC790\uC774\uC2E0 \uD558\uB098\uB2D8\uC5D0 \uB300\uD55C \uBCC0\uD638  34:21~30",`\uD558\uB098\uB2D8\uC740 \uC0AC\uB78C\uC758 \uAE38\uACFC \uAC78\uC74C\uC744 \uC8FC\uBAA9\uD558\uC2DC\uACE0 \uAC10\uCC30\uD558\uC2DC\uB294 \uBD84\uC785\uB2C8\uB2E4. \uC5D8\uB9AC\uD6C4\uB294 \uD558\uB098\uB2D8\uC758 \uC815\uC758\uB97C \uBCC0\uD638\uD558\uBA74\uC11C, \uADF8\uBD84\uC758 \uC804\uC9C0\uD558\uC2EC\uC744 \uAC15\uC870\uD569\uB2C8\uB2E4(21\uC808). \uD558\uB098\uB2D8 \uC55E\uC5D0\uC11C \uC545\uC778\uB4E4\uC774 \uC228\uC744 \uACF3\uC740 \uC5B4\uB514\uC5D0\uB3C4 \uC5C6\uC2B5\uB2C8\uB2E4. \uD558\uB098\uB2D8\uC740 \uC2EC\uD310\uC744 \uC704\uD574 \uC624\uB798 \uC0DD\uAC01\uD558\uC2E4 \uAC83\uC774 \uC5C6\uACE0, \uBAA8\uB4E0 \uC0AC\uB78C\uC774 \uBCFC \uC218 \uC788\uB3C4\uB85D \uC2EC\uD310\uD558\uC2ED\uB2C8\uB2E4. \uADF8\uBD84\uC740 \uAC00\uB09C\uD558\uACE0 \uBE48\uAD81\uD55C \uC790\uB4E4\uC758 \uBD80\uB974\uC9D6\uC74C\uC744 \uC678\uBA74\uD558\uC9C0 \uC54A\uC73C\uC2ED\uB2C8\uB2E4. \uB54C\uB85C \uADF8\uBD84\uC740 \uCE68\uBB35\uD558\uC2DC\uBA70 \uC5BC\uAD74\uC744 \uAC10\uCD94\uAE30\uB3C4 \uD558\uC2ED\uB2C8\uB2E4(29\uC808; \uC0AC 45:15). \uADF8\uB7EC\uB098 \uC774\uB294 \uD558\uB098\uB2D8\uC758 \uBD80\uC7AC\uAC00 \uC544\uB2C8\uBA70, \uB2E8\uC9C0 \uC778\uAC04\uC774 \uD558\uB098\uB2D8\uC744 \uC778\uC9C0\uD558\uC9C0 \uBABB\uD560 \uBFD0\uC785\uB2C8\uB2E4. \uD558\uB098\uB2D8\uC5D0 \uB300\uD55C \uC5D8\uB9AC\uD6C4\uC758 \uBB18\uC0AC\uB294 \uBAA8\uB450 \uB9DE\uC2B5\uB2C8\uB2E4. \uBB38\uC81C\uB294 \uADF8 \uB9D0\uC774 \uC560\uB9E4\uD558\uAC8C \uACE0\uB09C\uB2F9\uD558\uB294 \uC6A5\uC758 \uC0C1\uD669\uC5D0 \uC801\uC808\uD55C\uAC00\uC785\uB2C8\uB2E4.
-
\uC0AC\uB78C\uC758 \uAE38\uC744 \uC8FC\uBAA9\uD558\uC2DC\uB294 \uD558\uB098\uB2D8\uC740 \uC545\uC778\uC5D0\uAC8C \uC5B4\uB5BB\uAC8C \uD589\uD558\uC2DC\uB098\uC694? \uBAA8\uB4E0 \uC0B6\uC758 \uAC78\uC74C\uC744 \uAC10\uCC30\uD558\uC2DC\uB294 \uD558\uB098\uB2D8 \uC55E\uC5D0 \uB0B4 \uC0B6\uC740 \uC5B4\uB5A0\uD574\uC57C \uD560\uAE4C\uC694?`,"\uACB0\uB2E8 \uCD09\uAD6C\uC640 \uC6A5\uC5D0 \uB300\uD55C \uD3C9\uAC00  34:31~37",`\uC5D8\uB9AC\uD6C4\uB294 \uC6A5\uC5D0\uAC8C \uD68C\uAC1C\uC758 \uBAA8\uBC94\uC744 \uC18C\uAC1C\uD569\uB2C8\uB2E4(31~32\uC808). \uC6A5\uC774 \uC790\uC2E0\uC758 \uC8C4\uB97C \uC778\uC815\uD558\uACE0, \uC790\uC2E0\uC774 \uAE68\uB2EB\uC9C0 \uBABB\uD558\uB294 \uAC83\uC744 \uAC00\uB974\uCCD0 \uB2EC\uB77C\uACE0 \uD558\uB098\uB2D8\uAED8 \uBD80\uD0C1\uD558\uBA70, \uB2E4\uC2DC\uB294 \uC8C4\uC9D3\uC9C0 \uC54A\uACA0\uB2E4\uACE0 \uB2E4\uC9D0\uD588\uC5B4\uC57C \uD55C\uB2E4\uB294 \uAC83\uC785\uB2C8\uB2E4. \uC6A5\uC740 \uC774 \uBAA8\uB4E0 \uAC83\uC744 \uAC70\uBD80\uD588\uC2B5\uB2C8\uB2E4. \uC5D8\uB9AC\uD6C4\uB294 \u2018\uC2AC\uAE30\uB85C\uC6B4 \uC790\u2019\uC640 \u2018\uC9C0\uD61C \uC788\uB294 \uC0AC\uB78C\u2019\uC774\uB77C\uBA74 \uC6A5\uC758 \u2018\uC9C0\uC2DD \uC5C6\uC74C\u2019\uACFC \u2018\uC9C0\uD61C \uC5C6\uC74C\u2019\uC744 \uC9C0\uC801\uD588\uC744 \uAC83\uC774\uB77C\uACE0 \uD569\uB2C8\uB2E4(34~35\uC808). \uC774\uB7EC\uD55C \uD3C9\uAC00\uB97C \uAE30\uCD08\uB85C \uADF8\uB294 \uC6A5\uC744 \u2018\uC545\uC778\u2019\uC73C\uB85C \uADDC\uC815\uD569\uB2C8\uB2E4(36\uC808). \uBC18\uC5ED\uC744 \uB354\uD558\uACE0 \uD558\uB098\uB2D8\uC744 \uAC70\uC5ED\uD558\uB294 \uB9D0\uC744 \uB9CE\uC774 \uD588\uAE30\uC5D0 \uC6A5\uC774 \uACC4\uC18D \uC2DC\uD5D8\uC744 \uBC1B\uC544\uC57C \uD55C\uB2E4\uACE0 \uD569\uB2C8\uB2E4. \uD558\uB098\uB2D8\uC774 \uC758\uB86D\uB2E4\uACE0 \uC778\uC815\uD558\uC2E0(1:8) \uC6A5\uC744 \uC5D8\uB9AC\uD6C4\uB294 \uC545\uC778\uC73C\uB85C \uADDC\uC815\uD558\uACE0 \uB9D9\uB2C8\uB2E4. \uC774\uB294 \uD558\uB098\uC758 \uC7A3\uB300\uB85C \uBAA8\uB4E0 \uAC83\uC744 \uD3C9\uAC00\uD558\uB294 \uAC83\uC774 \uC5BC\uB9C8\uB098 \uBD80\uC801\uC808\uD55C \uACB0\uB860\uC5D0 \uB3C4\uB2EC\uD558\uAC8C \uB9CC\uB4DC\uB294\uC9C0\uB97C \uBCF4\uC5EC \uC90D\uB2C8\uB2E4.
-
\uC6A5\uC5D0 \uB300\uD55C \uC5D8\uB9AC\uD6C4\uC758 \uD3C9\uAC00\uC640 \uD558\uB098\uB2D8\uC758 \uD3C9\uAC00\uB294 \uC5B4\uB5BB\uAC8C \uB2E4\uB978\uAC00\uC694?(36~37\uC808; 1:8) \uB0B4\uAC00 \uD310\uB2E8\uD558\uB294 \uADF8 \uC0AC\uB78C\uC5D0 \uB300\uD55C \uD558\uB098\uB2D8\uC758 \uD3C9\uAC00\uB294 \uC5B4\uB5A0\uD560\uAE4C\uC694?`]};export{u as a,B as c,C as l};
